import React from 'react';
import ReactDOM from 'react-dom/client';
import { provder } from "react-redux"

import './index.css';
import App from './App';
import store  from './store';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <provder store = {store}>
        <App />
    </provder>
);
